import React, {useState, useEffect} from 'react';

export default function CarList (props){

  return(
    <ul>
      {props.carList.map(c => 
      <li key={c.id}>
          id {c.id} | reg {c.regNr} | vin {c.vehicleId} | status {c.isAvailable}          
      </li>)}
    </ul>
  )
}
